// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract MyNFT is ERC721, AccessControl, Ownable {
    uint256 public tokenId = 1;

    // Definir el rol de admin usando AccessControl
    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    struct NFT {
        uint256 tokenId;
        string tokenName;
        address owner;
        string tokenURI;
        uint8 rareza;   // Añadimos el atributo rareza
        uint256 precio; // Precio del NFT, calculado en base a la rareza
        bool enVenta;   // Estado de venta (si el NFT está disponible para comprar)
    }

    NFT[] public allTokens;
    mapping(address => NFT[]) public ownerTokens; // Almacenamos los tokens de cada usuario
    mapping(string => bool) public tokenExists;

    // Constructor que otorga el rol de admin al propietario del contrato
    constructor() ERC721("MyNFT", "NFT") {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN_ROLE, msg.sender);
    }

    // Modificador para restringir el acceso solo a admins
    modifier onlyAdmin() {
        require(hasRole(ADMIN_ROLE, msg.sender), "Caller is not an admin");
        _;
    }

    // Función para que solo los admins puedan asignar roles
    function grantAdminRole(address account) public onlyAdmin {
        grantRole(ADMIN_ROLE, account);
    }

    // Función para obtener los tokens de un usuario
    function getMyTokens() public view returns (NFT[] memory) {
        return ownerTokens[msg.sender];
    }

    // Función para obtener todos los tokens creados
    function getAllTokens() public view returns (NFT[] memory) {
        return allTokens;
    }

    // Determinar precio en base a la rareza
    function determinarPrecio(uint8 _rareza) internal pure returns (uint256) {
        if (_rareza == 1) return 0.5 ether; // Común
        if (_rareza == 2) return 1 ether;   // Raro
        if (_rareza == 3) return 2 ether;   // Épico
        if (_rareza == 4) return 5 ether;   // Legendario
        return 0.5 ether; // Por defecto
    }

    // Crear un nuevo token NFT (con rareza y precio automático basado en la rareza)
    function mintToken(
        string calldata _tokenName,
        string calldata _tokenURI,
        uint8 _rareza
    ) public onlyAdmin {
        require(!tokenExists[_tokenName], "Token already exists");
        require(_rareza >= 1 && _rareza <= 4, "Rareza invalida");

        uint256 precioFinal = determinarPrecio(_rareza);

        _safeMint(msg.sender, tokenId);

        NFT memory newToken = NFT(tokenId, _tokenName, msg.sender, _tokenURI, _rareza, precioFinal, true); // Marcamos en venta
        allTokens.push(newToken);
        ownerTokens[msg.sender].push(newToken);
        tokenExists[_tokenName] = true;

        tokenId++;
    }

    // Función para comprar un NFT directamente basado en su precio
    function comprarNFT(uint256 _tokenId) public payable {
        require(_exists(_tokenId), "Token does not exist");
        NFT storage token = allTokens[_tokenId - 1]; // Obtener el NFT por ID
        require(token.enVenta, unicode"NFT no está en venta");
        require(msg.value >= token.precio, unicode"Fondos insuficientes");

        // Transferir el NFT al comprador
        address vendedor = ownerOf(_tokenId);
        _transfer(vendedor, msg.sender, _tokenId);

        // Transferir los fondos al vendedor
        payable(vendedor).transfer(msg.value);

        // Actualizar el estado del NFT
        token.owner = msg.sender;
        token.enVenta = false; // Ya no está en venta
    }

    // Función para permitir al propietario poner en venta un NFT nuevamente
    function ponerEnVenta(uint256 _tokenId, uint256 _nuevoPrecio) public {
        require(_exists(_tokenId), "Token does not exist");
        require(ownerOf(_tokenId) == msg.sender, unicode"Solo el dueño puede poner en venta");

        NFT storage token = allTokens[_tokenId - 1];
        token.enVenta = true;
        token.precio = _nuevoPrecio;
    }

    // Función para actualizar el tokenURI de un NFT existente (solo admins pueden actualizar)
    function updateTokenURI(uint256 _tokenId, string calldata _newTokenURI) public onlyAdmin {
        require(_exists(_tokenId), "Token does not exist");
        allTokens[_tokenId - 1].tokenURI = _newTokenURI;
    }

    // Función para eliminar un token (solo admins pueden eliminar)
    function deleteToken(uint256 _tokenId) public onlyAdmin {
        require(_exists(_tokenId), "Token does not exist");

        address owner = ownerOf(_tokenId);
        
        // Eliminar el token del dueño
        for (uint i = 0; i < ownerTokens[owner].length; i++) {
            if (ownerTokens[owner][i].tokenId == _tokenId) {
                ownerTokens[owner][i] = ownerTokens[owner][ownerTokens[owner].length - 1];
                ownerTokens[owner].pop();
                break;
            }
        }

        // Eliminar el token de allTokens
        allTokens[_tokenId - 1] = allTokens[allTokens.length - 1];
        allTokens.pop();

        // Eliminar el token del contrato
        _burn(_tokenId);
    }

    // Implementación de la función para devolver la URI del token
    function tokenURI(uint256 _tokenId) public view override returns (string memory) {
        require(_exists(_tokenId), "Token does not exist");
        return allTokens[_tokenId - 1].tokenURI;
    }

    // Sobrescribir supportsInterface para evitar conflictos entre ERC721 y AccessControl
    function supportsInterface(bytes4 interfaceId) public view override(ERC721, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
